    <div data-cy="navbar">
      <Link data-cy="navbar-home-link">Home</Link>
      <span data-cy="navbar-cart-items-count">{count}</span>
      <button data-cy="navbar-login-logout-button">Logout</button>
    </div>
  );
};

export default Navbar;
